import React from "react";
import { Route, Switch } from "react-router-dom";
import { HomePage } from "./pages/home-page/home-page.component.jsx";

const HatsPage = () => {
	return (
		<div>
			<h1>HATS PAGE</h1>
		</div>
	);
};

function App() {
	return (
		<div>
			<Switch>
				<Route exact path="/" component={HomePage} />
				<Route path="/hats" component={HatsPage} />
			</Switch>
		</div>
	);
}

export default App;
